import React from 'react';

import { Link } from 'react-router';

import { NavToProdBtn, ErrorBoundary } from '../components';
import Button from '@material-ui/core/Button';

import napkinsImg from '../assets/napkins.webp';
import toiletsImg from '../assets/toilets.webp';

import './HomePage.css';

export const HomePage = () => {
	return (
    <ErrorBoundary>
  		<section className="home-page__container" data-theme="light">
        <nav className="home-page__navigation">        
          <li className="navigation__item">
            <Link to="/production/napkins">
              <Button variant="outlined" color="default">
                <img src={napkinsImg} alt="Салфетки" />
              </Button>
            </Link>
          </li>
          <li className="navigation__item">
            <Link to="/production/toilets">
              <Button variant="outlined" color="default">
                <img src={toiletsImg} alt="Туалетная бумага" />
              </Button>
            </Link>
          </li>
        </nav>
  		</section>
    </ErrorBoundary>
	);
}
